import "./movies.css";
import Skeleton, { SkeletonTheme } from "react-loading-skeleton";
const Movies = () => {
  return (
    <>
      <SkeletonTheme color="#202020" highlightColor="#444"></SkeletonTheme>
      <div className="grid">
        <div className="card">
          <div className="img">
            {<Skeleton height={400} />}
            <img src="./images/space.jpg" alt=""></img>
          </div>
          <h2 className="title">Hello</h2>
        </div>
        <div className="card">
          <div className="img">
            {<Skeleton height={400} />}
            <img src="./images/space.jpg" alt=""></img>
          </div>
          <h2 className="title">Hello</h2>
        </div>
        <div className="card">
          <div className="img">
            {<Skeleton height={400} />}
            <img src="./images/space.jpg" alt=""></img>
          </div>
          <h2 className="title">Hello</h2>
        </div>
      </div>
    </>
  );
};

export default Movies;
